  "privacy_content": "<h2>Oznámenie o ochrane osobných údajov</h2> <p>Toto oznámenie o ochrane osobných údajov sa vzťahuje na používanie produktu elektronické informácie o liekoch združenia PharmaLedger Association. </p> <h2>Kontakty</h2><p><b>a) Totožnosť a kontakty na správcu alebo spoločných správcov</b></p><p>Správcom vašich údajov je PharmaLedger Association. </p> <p><b>b) Kontakty na osobu zodpovednú za ochranu údajov</b></p><p>Kanceláriu pre ochranu údajov združenia PharmaLedger Association možno kontaktovať na dpo@pharmaledger.org.</p><h2>Aké osobné údaje používame</h2><p>Zhromažďujeme iba technické údaje potrebné na doručenie vašej elektronickej informácie. To zahŕňa vašu IP adresu a technické identifikátory zariadenia a prehliadača, ktoré používate na prístup k našej aplikácii.</p> <p><em>Konkrétne zhromažďujeme nasledujúce dátové prvky: </em></p><ul ><li><p><em>Prístup do mobilného zariadenia.</em> Môžeme požiadať o prístup alebo povolenie k určitým funkciám z vášho mobilného zariadenia, vrátane fotoaparátu vášho mobilného zariadenia a ďalších funkcií. Ak chcete zmeniť náš prístup alebo povolenia, môžete tak urobiť v nastaveniach svojho zariadenia.</p></li><li><p><em>Údaje o mobilnom zariadení.</em> Automaticky zhromažďujeme informácie o zariadení (ako ID vášho mobilného zariadenia, model a výrobca), o operačnom systéme, informácie o verzii a konfigurácii systému, identifikačné čísla zariadenia a aplikácie, typ a verziu prehliadača, model hardvéru poskytovateľa internetových služieb a/alebo mobilného operátora a adresu internetového protokolu (IP) (alebo proxy server). Ak používate naše aplikácie, môžeme tiež zhromažďovať informácie o telefónnej sieti spojenej s vaším mobilným zariadením, o operačnom systéme alebo platforme vášho mobilného zariadenia, type mobilného zariadenia, ktoré používate, o jedinečnom ID vášho mobilného zariadenia a informácie o funkciách našich aplikácií, ku ktorým ste pristupovali. </p></li></ul><h2>Prečo zhromažďujeme vaše osobné údaje</h2><p><b>Účely </b></p><p>Vaše technické údaje zhromažďujeme s cieľom poskytnúť vám elektronickú informáciu o vašom lieku. </p><p>Pri spracúvaní vašich osobných údajov sa môžeme opierať o nasledujúce právne základy:</p><ul><li><p><b>Plnenie zmluvy.</b> Vaše osobné údaje môžeme spracúvať, keď sa domnievame, že je to nevyhnutné na plnenie zmluvných záväzkov voči vám, vrátane poskytovania našich Služieb alebo na vašu žiadosť pred uzavretím zmluvy s vami.</p></li><li><p><b>Zákonné povinnosti.</b> Vaše údaje môžeme spracúvať, keď sa domnievame, že je to nevyhnutné na plnenie našich zákonných povinností, ako je napríklad plnenie našich povinností vyplývajúcich z regulácie zdravotnej starostlivosti a právnych predpisov v oblasti verejného zdravia.</p></li></ul><h2>Komu sprístupňujeme vaše osobné údaje</h2><p>Členské spoločnosti a poskytovatelia služieb tretích strán.</p><p>Vaše údaje sprístupňujeme dodávateľom tretích strán, poskytovateľom služieb, zmluvným partnerom alebo zástupcom („tretie strany“), ktorí poskytujú služby pre nás alebo v našom mene a vyžadujú prístup k týmto údajom, aby mohli vykonávať túto prácu. S našimi tretími stranami máme uzatvorené zmluvy, ktoré sú navrhnuté tak, aby pomáhali chrániť vaše osobné údaje. To znamená, že s vašimi osobnými údajmi nemôžu nič robiť, pokiaľ im na to nedáme pokyn. Taktiež nebudú sprístupňovať vaše osobné údaje žiadnej organizácii okrem nás. Zaväzujú sa tiež chrániť údaje, ktoré získali v našom mene, a uchovávať ich na čas, ktorý im nariadime. Kategórie tretích strán, ktorým môžeme sprístupňovať osobné údaje, sú nasledovné:</p><ul><li><p>Výrobcovia liekov (členské spoločnosti)</p></li><li><p>Poskytovatelia technických služieb</p></li></ul><h2>Ako dlho uchovávame vaše osobné údaje</h2><p>PharmaLedger Association uchováva vaše technické údaje iba tak dlho, ako je potrebné na spracovanie vašej žiadosti o písomnú informáciu, najviac 30 dní. </p><p>Výrobca vášho lieku bude tiež uchovávať vaše údaje určitý čas definovaný v jeho zásadách uchovávania údajov. Ak chcete získať ďalšie informácie o tomto uchovávaní, kontaktujte výrobcu svojho lieku.</p><h2 >Ak nám neposkytnete svoje osobné údaje</h2><p>Ak sa rozhodnete neposkytnúť nám svoje technické údaje, nebudeme môcť splniť vašu žiadosť o písomnú informáciu.</p><h2>Vaše práva</p></h2><p>Ak máte akékoľvek požiadavky týkajúce sa vašich osobných údajov podľa GDPR, ako žiadosť o prístup k vašim údajom alebo o ich vymazanie, môžete nás kontaktovať na dpo@pharmaledger.org.</p><p>Tieto žiadosti spracúvame do 30 dní.</p><h2>Odvolanie súhlasu</h2><p>Ak máte akékoľvek požiadavky týkajúce sa vašich osobných údajov podľa GDPR, ako žiadosť o prístup k vašim údajom alebo o ich vymazanie, môžete nás kontaktovať na dpo@pharmaledger.org.</p><p>Tieto žiadosti spracúvame do 30 dní.</p><h2>Automatizované rozhodovanie</h2><p>Pri poskytovaní tejto služby nevyužívame žiadne automatizované rozhodovanie.</p><h2>Medzinárodný prenos osobných údajov</h2><p>Ak výrobca vášho lieku vyžaduje, aby sme preniesli vaše údaje mimo Európskej únie, na ochranu vašich údajov používame štandardné zmluvné doložky.</p><h2>Ako podať sťažnosť</h2><p>Ak máte akékoľvek požiadavky týkajúce sa vašich osobných údajov podľa GDPR, ako žiadosť o prístup k vašim údajom alebo o ich vymazanie, môžete nás kontaktovať na dpo@pharmaledger.org.</p> <p>Tieto žiadosti spracúvame do 30 dní. Okrem toho sa môžete obrátiť na váš miestny dozorný orgán, ak máte pocit, že sa vaše práva nedodržiavajú.</p>",
