  "terms_content": "<h2>Obchodné podmienky pre webovú stránku a aplikáciu s elektronickými informáciami o liekoch združenia PharmaLedger Association </h2><p>Prístupom alebo používaním webovej stránky a aplikácie s elektronickými informáciami o liekoch združenia PharmaLedger Association (ďalej len „Služby“) súhlasíte s tým, že budete viazaní týmito obchodnými podmienkami (ďalej len „Podmienky“). Ak s týmito Podmienkami nesúhlasíte, nemôžete mať prístup k Službám ani ich využívať. Služby prevádzkuje združenie PharmaLedger Association (ďalej len „Združenie“) a sú určené na použitie pre osoby, ktoré hľadajú informácie o svojom lieku. Služby poskytuje sieť viacerých strán a písomnú informáciu o lieku zobrazenú prostredníctvom Služieb dodáva výrobca vášho lieku. Združenie vystupuje ako správca údajov týkajúcich sa tejto písomnej informácie. </p><h2>Používanie Služieb </h2><p>Súhlasíte s tým, že Služby budete používať iba na zákonné účely a spôsobom, ktorý neporušuje práva alebo neobmedzuje či nebráni používaniu a užívaniu Služieb akoukoľvek treťou stranou. Takéto obmedzenie alebo zábrana zahŕňa, nie výlučne, správanie, ktoré je nezákonné alebo ktoré môže obťažovať alebo spôsobovať tieseň alebo nepríjemnosti akejkoľvek osobe, a prenos obscénneho alebo urážlivého obsahu alebo narušenie bežného toku dialógu v rámci Služieb.</p><h2>Duševné vlastníctvo </h2><p>Obsah Služieb, vrátane, ale nie výlučne, textu, grafiky, obrázkov a softvéru, je majetkom Združenia alebo jeho poskytovateľov licencií a členských spoločností a je chránený autorským právom a inými zákonmi o duševnom vlastníctve. Bez výslovného písomného súhlasu Združenia nesmiete použiť žiadny obsah zo Služieb na komerčné účely. </p><h2>Zodpovednosť</h2><p>Združenie neposkytuje žiadne vyhlásenia ani záruky akéhokoľvek druhu, výslovné alebo predpokladané, pokiaľ ide o prevádzku Služieb alebo informácií, obsahu, materiálov alebo liekov zahrnutých v Službách. Združenie nezodpovedá za žiadne škody akéhokoľvek druhu vyplývajúce z používania Služieb, vrátane, ale nie výlučne, priamych, nepriamych, náhodných, represívnych a následných škôd. </p><h2>Rozhodné právo </h2><p>Tieto Podmienky a používanie Služieb vami sa budú riadiť a vykladať zákonmi Švajčiarska a akékoľvek spory sa budú riešiť na súdoch v Bazileji vo Švajčiarsku. </p><h2>Zmeny Podmienok </h2><p>Združenie si vyhradzuje právo kedykoľvek zmeniť tieto Podmienky a vy ste zodpovední za pravidelné kontrolovanie prípadných zmien týchto Podmienok. Vaše ďalšie používanie Služieb po vykonaní akýchkoľvek zmien Podmienok bude znamenať váš súhlas s upravenými Podmienkami.</p><p><br></p>",
