  "about_content": "<h2>O tejto aplikácii</h2><p>Túto aplikáciu vám poskytuje PharmaLedger®. Spoločne ju vyvinuli organizácie zastupujúce pacientov, farmaceutické spoločnosti a odborníci na technológie.</p><p>Používateľom aplikácie umožňuje zobraziť informácie o ich lieku naskenovaním kódu na obale lieku.</p><p>Zobrazené informácie poskytuje držiteľ rozhodnutia o registrácii lieku.</p><h2>O PharmaLedger</h2><p>PharmaLedger® je obchodná značka združenia PharmaLedger Association (PLA).</p><p>PLA je svetové neziskové, neutrálne združenie. Cieľom združenia je vytvárať a podporovať ekosystém digitálnej dôvery v zdravotníctve.</p><p>Združenie napomáha spolupráci v sektoroch zdravotníctva a prírodných vied a podporuje inovácie a ich implementáciu vo vzájomný prospech pacientov a ostatných zainteresovaných strán.</p>",
