  "help_content": "<div><p><b><h2>Čo je EPI? </h2></b></p><p> <b>EPI</b> je skratka pre <b> elektronickú informáciu o lieku.</b> Je to elektronická verzia papierovej písomnej informácie o lieku, ktorú zvyčajne nájdete vo vnútri balenia lieku. V niektorých prı́padoch môže <b>EPI</b> nahradiť papierovú písomnú informáciu.</p><p><b><h2>Čo je PharmaLedger? </h2></b></p><p>PharmaLedger Association (PLA) je neziskové združenie so sı́dlom vo Švajčiarsku, ktorého cieľom je umožniť a podporovať ekosystém digitálnej dôvery v zdravotnı́ctve prostrednı́ctvom štandardizovanej a dôveryhodnej platformy s otvoreným zdrojom. PLA podporuje spoluprácu a urýchľuje inovácie a ich prijı́manie s cieľom dosahovať vzájomné výhody v oblasti zdravotnej starostlivosti a prírodných vied pre pacientov a ďalšie zainteresované strany. PLA vznikla v roku 2022, aby pokračovala v práci na projekte PharmaLedger, 3-ročnom projekte financovanom Európskou komisiou a farmaceutickým priemyslom, ktorého cieľom je dokázať hodnotu blockchain riešenı́. Ďalšie informácie sú dostupné na https://pharmaledger.org.</p><p><b><h2>Čo je DataMatrix? </h2></b></p><p>Je to typ kódu na balenı́ vášho lieku. Je to čierno-biely štvorčekový kód a bude vyzerať podobne ako tento: <br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>Ako aplikáciu používať? </h2></b></p><p>Postupujte podľa pokynov na vstupnej stránke <b>aplikácie... </b> ukáže sa vám obrázok, ako nájsť <b>DataMatrix</b> na balení vášho lieku. Keď nájdete <b>DataMatrix</b>, kliknite na tlačidlo „Naskenovat <b>DataMatrix</b>\". Povoľte aplikácii používať fotoaparát, aby bolo možné naskenovať <b>DataMatrix</b>. Fotoaparátom zaostrite na <b>DataMatrix</b>. Po úspešnom naskenovaní obalu sa zobrazí <b>EPI</b>. Kliknutím na tlačidlo „+“ získate ďalšie podrobnosti.</p><p><b><h2>Prečo moje skenovanie DataMatrixu nedáva výsledok?</h2></b></p><p>Je niekoľko dôvodov, prečo <b>DataMatrix</b> na vašom balení nemusí poskytovať EPI. Jedným z dôvodov môže byť zaostrenie fotoaparátu. Skúste kód naskenovať na dobre osvetlenom mieste, aby bol jasne viditeľný na obrazovke. Ak sa vám nedarí držať ruku pevnú, môžete skúsiť podoprieť si ruky o stôl.</p></div>",
